import React from 'react';
import './App.css';

function App() {
  return (

    <div>
      <HelloWorld nombre = "Marcos" titulo = "estdiante"/>
      <HelloWorld nombre = "Jorge" titulo = "estudiante"/>
      <HelloWorld nombre = "Stalin" titulo = "estdiante"/>
      <HelloWorld nombre = "Richard"/>
      <HelloWorld nombre = "Mayra"/>
    </div>
  );
}



function HelloWorld(props){
  console.log(props)
  return (
    <div id= "Hello">
